function save(name, data) {
    const link = document.createElement( 'a' );
    link.style.display = 'none';
    document.body.appendChild( link );


    const blob = new Blob( [ data ], { type: 'application/octet-stream' } );
    link.href = URL.createObjectURL( blob );
    link.download =  name;
    link.click();
}

